local b64image = ""

function toga_smodscatloadscreen()
	if not b64 then return end
	if not smodscatimg then
		smodscatimg = love.graphics.newImage(love.filesystem.newFileData(b64.decode(b64image), 'thesmodscat'))
	end
	if not smodscatimg then return end
    if smodscatimg then
		local realw, realh = love.window.getMode()
		love.graphics.draw(smodscatimg, realw/2 - 264, realh/2 - 27, 0, 1, 1)
		love.graphics.rectangle('line', realw/2 - 264, realh/2 - 27, 96, 96, 5)
	end
end